export default function updateStudentGradeByCity (list, city, newGrades) {
  const cityList = list.filter((x) => x.location === city);
  return cityList.map((x) => {
    for (const i in newGrades) {
      if (i.studentId === x.id) {
        x.grade == i.grade;
      } else {
        x.grade == 'N/A';
      }
    }
  });
}
